import java.io.Serializable;
import java.util.Objects;

public class CfgSkillId implements Serializable {

    private Double id;
    private String name;
    private String column3;
    private String column4;

    public Double getId() {
        return this.id;
    }

    public void setId(Double id) {
        this.id = id;
    }

    public String getName() {
        return this.name;
    }

    public void setName(String name) {
        this.name = name;
    }

    public String getColumn3() {
        return this.column3;
    }

    public void setColumn3(String column3) {
        this.column3 = column3;
    }

    public String getColumn4() {
        return this.column4;
    }

    public void setColumn4(String column4) {
        this.column4 = column4;
    }

    @Override
    public boolean equals(Object o) {
        if (this == o) return true;
        if (!(o instanceof CfgSkill)) return false;
        final CfgSkill cfgSkill = (CfgSkill) o;
        return Objects.equals(getId(), cfgSkill.getId()) &&
                Objects.equals(getName(), cfgSkill.getName()) &&
                Objects.equals(getColumn3(), cfgSkill.getColumn3()) &&
                Objects.equals(getColumn4(), cfgSkill.getColumn4());
    }

    @Override
    public int hashCode() {
        return Objects.hash(getId(),
                getName(),
                getColumn3(),
                getColumn4());
    }
}
